import React, { Component } from 'react';

class Product extends Component {
    
    render() {
        const {id,title,image,price,inCart}=this.props.product;
        console.log(title)
        return (
            <div className="container">
            <div className="row">
            {id}{title} <img src={image} alt='image'/>{price}
            {inCart}
            </div>
            
            </div>
        );
    }
}

export default Product;
